INSERT INTO `Restaurant` VALUES (0,'Burger King','Chain in Chinatown offering flame-grilled burgers, breakfast sandwiches, and sides. Favourites include Whopper With Cheese Meal, 10pc Chicken Nuggets.','1328 Douglas Street, Victoria, BC V8W 2E8','Victoria','2024-07-02'),(1,'The Ruby',NULL,'642a Johnson St, Victoria, BC V8W 1M6','Victoria','2024-07-02'),(2,'Subway','Subway in Chinatown offering subs, wraps, salads, and breakfast items. Favourites include Italian B.M.T, Turkey Breast, Steak & Cheese.','1324 Douglas Street, Victoria, BC V8W','Victoria','2024-07-02'),(4,'Shanzee\'s Biscuit Cafe','Chinatown cafe known for Biscuit Benny, Trailer Jam, and Happy Campers Breakfast. Offers biscuits, burgers, breakfast items.','529 Pandora Ave, Victoria, BC V8W 1N5','Victoria','2024-07-02'),(5,'Crispy Classic Chicken',NULL,'1327 Douglas St. & Johnson, VICTORIA, BC V8W 2E9','Victoria','2024-07-02'),(6,'Rise and Grind','Downtown cafe with wraps, salads, sandwiches, and lattes. Favourites include The Originator, Boss Hog, The Foghorn.','1294 Broad St, Victoria, BC V8W','Victoria','2024-07-02'),(7,'Castello Coffee','Chinatown cafe with bagels, muffins, and a variety of lattes. Favourites include Belt Bagel, Cafe Latte.','1802 Douglas Street, Victoria, BC V8W','Victoria','2024-07-02'),(9,'Cat\'s Coffee & Cake','Chinatown cafe with swiss rolls, cheesecakes, and iced beverages. Favourites include Iced Latte, Mixed Berries Tiramisu.','1213 Douglas Street, Victoria, BC V8W','Victoria','2024-07-02'),(10,'Yates Coffee Bar','Chinatown coffee bar with bakery items, breakfast fare, wraps, and crunch wraps. Popular for Peanut Butter & Banana Puppy Treats.','733 Yates St, Victoria, NAMER V8W 1L6','Victoria','2024-07-02'),(11,'Franks Honeybun Cafe',NULL,'605 Yates  Street , Victoria, BC V8w1l1','Victoria','2024-07-02'),(12,'McDonald\'s','Fast-food chain in Harris Green with burgers, wraps, and breakfast items. Big Mac and McNuggets favored.','980 Pandora Avenue, VICTORIA, BC V8V 3P3','Victoria','2024-07-02'),(13,'Broughton Street Deli','Downtown deli known for Reuben, Montreal Smoked Meat Combo, Turkey Clubhouse. Offers wraps, bennys, and waffles.','648 Broughton Street, Victoria, BC V8W 1C9','Victoria','2024-07-02'),(14,'Wendy\'s','Chain in Chinatown with cheeseburgers, breakfast items, and frosty treats. Favourites include Jr. Bacon Cheeseburger, Spicy Chicken Sandwich.','776 Bay Street, Victoria, BC V8T 1R1','Victoria','2024-07-02'),(15,'Tractor Foods','Health-focused eatery in Downtown with bowls, salads, and market sides. Favourites include Nourish Bowl, Everyday Bowl.','805 Government Street, Victoria, BC V8W','Victoria','2024-07-02'),(16,'COBS Bread Bakery','Bakery in Harris Green specializing in loaves, pastries, and scones. Favourites include Ham & Cheese Croissant.','Unit 140a - 911 Yates Street, Victoria, NAMER V8V 4X3','Victoria','2024-07-02'),(17,'Denny\'s','Chain in Rock Bay with breakfast slams, pancakes, omelettes, and skillets. Favourites include Lumberjack Slam.','2852 Douglas St, Victoria, BC V8T 4M5','Victoria','2024-07-02'),(18,'Tombo Eats',NULL,'732 Yates Street, Victoria, NAMER V8W 1L4','Victoria','2024-07-02'),(19,'Starbucks','Chain in Downtown featuring coffees, baked goods, sandwiches, and snacks. Favourites include Caff Latte, Caramel Macchiato.','801 Fort Street, Victoria, BC V8W','Victoria','2024-07-02'),(20,'Fern Cafe and Bakery','Cafe and bakery in Harris Green with breakfast options, burgers, and baked goods. Favourites include Breakfast Sandwich and Daily Doughnut.','1115 N Park St, Victoria, BC V8T 1C7','Victoria','2024-07-02'),(21,'2% Jazz Coffee','Rock Bay coffee shop with whole beans, baked goods, and lunch options. Cafe Latte and Breakfast Burrito are favourites.','740 Hillside Ave #105, VICTORIA, BC V8T 1Z4','Victoria','2024-07-02'),(22,'White Spot','Diner in South Jubilee with classics like burgers, chicken dishes, and milkshakes. Favourites include The Legendary, Double Double Burger.','1871 Fort St, Victoria, BC 